import React, { useContext, useState } from 'react';
import "./AboutPage.css";
import PageList from '../../components/PageList/PageList';
import AuthContext from '../../components/AuthContext/AuthContext';

const AboutPage = () => {



  const menuItems = [
    {
      name: 'O Sigma Akademiji',
      path: '/informacije',
    },
    {
      name: 'Osnivači',
      path: '/informacije',
    },
    {
      name: 'Predavači',
      path: '/informacije',
    },
    {
      name: 'Naši Prijatelji',
      path: '/informacije',
    }, 
    {
      name: 'Kontakt',
      path: '/informacije',
    }
  ]; 

  const {activeIndex} = useContext(AuthContext);

  return (
    <div className='AboutPage__container'>
      <div className='AboutPage__container-left'>
        <div className='AboutPage__PageList-container'>
          {menuItems.map((item, index) => (
              <PageList key={index} item={item} index={index} />
          ))}
        </div>
      </div>

         <div className='AboutPage__container-right'>
         { activeIndex === 0 &&
              <div className='AboutPage__section'>
                <h1 className='AboutPage__section-heading'>Sigma Akademija</h1>

                <div className='AboutPage__section-infoText'>
                    <h2>O Nama</h2>
                    <p>Akademija Sigma je specijalizovana online platforma kreirana sa ciljem da podrži i unapredi matematičke veštine i znanje mladih entuzijasta širom sveta. Naša misija je da inspirišemo, obrazujemo i osnažimo nove generacije matematičara, pružajući im alate i resurse potrebne za uspeh na raznim matematičkim takmičenjima i u akademskim sferama.</p>

                    <h2>Naši Programi</h2>
                    <p>Akademija Sigma nudi raznovrsne programe i kurseve prilagođene različitim nivoima znanja i interesovanjima:</p>
                    <div>
                        <p><strong>Osnovni Kursevi:</strong> Idealni za učenike osnovnih škola koji žele da steknu čvrste osnove u matematici i razviju logičko razmišljanje.</p>
                        <p><strong>Napredni Kursevi:</strong> Namenjeni srednjoškolcima i učenicima sa naprednim znanjem, ovi kursevi pokrivaju kompleksne matematičke teme i pripremaju polaznike za nacionalna i međunarodna takmičenja.</p>
                        <p><strong>Pripreme za Takmičenja:</strong> Specijalizovani programi koji pružaju intenzivnu pripremu za različita matematička takmičenja, uključujući IMO, Balkanijadu, Kengur i mnoga druga.</p>
                        <p><strong>Mentorski Programi:</strong> Jedinstvena prilika za individualni rad sa iskusnim mentorima, koji su sami bili uspešni takmičari i sada žele da svoje znanje i iskustvo prenesu novim generacijama.</p>
                    </div>

                    <h2>Naša Metodologija</h2>
                    <p>Verujemo da je svaki učenik jedinstven, te naši programi koriste personalizovan pristup učenju. Kombinujemo tradicionalne metode sa inovativnim tehnologijama kako bismo osigurali da svaki polaznik dobije podršku prilagođenu njegovim potrebama i ritmu učenja. Naši kursevi su interaktivni, sadrže veliki broj praktičnih zadataka, video lekcija, kvizova i simulacija takmičenja.</p>

                    <h2>Naš Tim</h2>
                    <p>Na Akademiji Sigma ponosimo se našim timom stručnjaka i entuzijasta, koji uključuje priznate profesore matematike, bivše takmičare i stručnjake iz oblasti obrazovanja. Svi naši instruktori poseduju bogato iskustvo u radu sa mladim talentima i imaju duboku strast prema matematici.</p>

                    <h2>Zašto Odabrati Akademiju Sigma?</h2> 

                    <div>
                        <p><strong>Fleksibilnost:</strong> Učite kad god i gde god želite, zahvaljujući našoj online platformi.</p>
                        <p><strong>Kvalitet:</strong> Pristup vrhunskim resursima i ekspertizi našeg tima.</p>
                        <p><strong>Podrška:</strong> Stalna podrška kroz mentorstvo i interaktivne sesije.</p>
                        <p><strong>Zajednica:</strong> Postanite deo globalne zajednice mladih matematičara i delite svoja iskustva i znanje.</p>
                    </div>

                    <h2>Kontakt</h2>
                    <p>Za više informacija o našim programima i upisu, posetite našu veb stranicu ili nas kontaktirajte putem emaila: <a href="mailto:info@sigma-akademija.com">info@sigma-akademija.com</a>.</p>


                </div>
              </div>
        }
   </div>


    </div>
  );
};

export default AboutPage;
